(47, 'woocommerce-WCReturnsWarranty-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Returns and Warranty Requests extension', '<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:15', NULL, 0, 'plain', '', 0, 0, 'info'),
(48, 'woocommerce-WCOPC-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce One Page Checkout', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(49, 'woocommerce-WCGC-July-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce GoCardless Extension', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(50, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(51, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(52, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(53, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(54, 'woocommerce-WooPayments-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooPayments (WooCommerce Payments) plugin', '<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(55, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(56, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(57, 'woo-activation-survey-blockers-22AUG23', 'info', 'en_US', 'How can we help you get that first sale?', 'Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(58, 'woocommerce-usermeta-Sept2023-productvendors', 'update', 'en_US', 'Your store requires a security update', '<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(59, 'Klarna_10OCT23', 'marketing', 'en_US', 'Klarna is now available', 'This is a test. Klarna is now available.', '{}', 'pending', 'woocommerce.com', '2023-10-11 08:47:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(60, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Sambungkan ke WooCommerce.com', 'Sambungkan untuk mendapatkan pemberitahuan dan pembaruan produk penting.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-11 08:47:39', NULL, 0, 'plain', '', 0, 0, 'info'),
(61, 'wc-admin-install-jp-and-wcs-plugins', 'info', 'en_US', 'Ah Oh Terjadi kesalahan selama penginstalan Jetpack dan Pengiriman & Pajak WooCommerce. Harap coba lagi.', 'Kami mendapati bahwa ada kesalahan selama penginstalan Jetpack dan Pengiriman &amp; Pajak WooCommerce. Harap coba lagi dan nikmati semua keuntungan dengan menyambungkan plugin ke toko Anda! Maaf atas ketidaknyamanannya. Plugin \"JetPack\" dan \"Pengiriman &amp; Pajak WooCommerce\" akan diinstal &amp; diaktifkan secara gratis.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-11 08:50:47', NULL, 0, 'plain', '', 0, 1, 'info'),
(62, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Memilih tema?', 'Periksa tema yang kompatibel dengan WooCommerce dan pilih tema yang sesuai dengan kebutuhan merek dan bisnis Anda.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-18 06:43:58', NULL, 0, 'plain', '', 0, 1, 'info'),
(63, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'Cara menyesuaikan katalog produk Anda', 'Anda pasti ingin katalog produk dan gambar terlihat bagus dan sesuai dengan merek Anda. Panduan ini akan memberikan semua tips yang diperlukan agar produk Anda tampil keren di toko.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-18 06:43:58', NULL, 0, 'plain', '', 0, 1, 'info'),
(64, 'wc-admin-mobile-app', 'info', 'en_US', 'Instal aplikasi seluler Woo', 'Instal aplikasi seluler WooCommerce untuk mengelola pesanan, menerima pemberitahuan penjualan, dan melihat metrik kunci — di mana pun Anda berada.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-18 06:43:58', NULL, 0, 'plain', '', 0, 1, 'info'),
(65, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', 'Mulai menerima pembayaran di toko Anda!', 'Ambil pembayaran dengan penyedia yang cocok dengan Anda - pilih dari 100+ gerbang pembayaran untuk WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-18 06:43:58', NULL, 0, 'plain', '', 0, 1, 'info'),
(66, 'wc_com_in_person_payments_card_sale_US_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Now’s the perfect time to do so, as we’re discounting our M2 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Don’t miss out — this offer ends October 29, 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-18 06:44:18', NULL, 0, 'plain', '', 0, 0, 'info'),
(67, 'wc_com_in_person_payments_card_sale_UK_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Now’s the perfect time to do so, as we’re discounting our WisePad 3 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Don’t miss out — this offer ends 29th October 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-18 06:44:18', NULL, 0, 'plain', '', 0, 0, 'info'),
